Makeup + story time: a series where I talk about random unrelated topics while getting ready for my day 😬 

Mini reviews: 
@faebeautyofficial spf juice (11/10) hands down the best spf you will try 

@clinique_in even better concealer in oat (9/10) love the formula it’s so lightweight but the shade is a bit too orange for me 

@nudestix concealer (7/10) works well only over other hydrating concealers 

@diorbeauty backstage eyebrow palette (12/10) literally the best brow product I’ve used 

@benefitindia brow setter (12/10) a brow gel unlike any other 

@tomfordbeauty cream bronzer (10/10) lovely formula the highlighter in this palette is even better than the bronzer

@maccosmeticsindia mac stack (12/10) wonderful wonderful wonderful formula that I don’t have to use with a lash primer 

@clinique_in black honey (9/10) lovely shade which I only realised upon second use but in terms of formula I feel there are dupes 

__

